figure1 = figure;

% Create axes
axes1 = axes('Parent',figure1,'XGrid','on');
hold(axes1,'all');

% Create multiple lines using matrix input to plot
plot1 = plot(YMatrix1,'Parent',axes1,'LineWidth',2);
