% Create xlabel
xlabel('Etapa de Desempeño');

% Create ylabel
ylabel('Valor Medida de Evaluación');

% Create legend
legend1 = legend(axes1,'show');
set(legend1,...
    'Position',[0.686188384577844 0.437089201877935 0.180819912152269 0.328638497652582]);

